create table swine
(
    swine_index   int auto_increment
        primary key,
    swine_id      varchar(64) not null,
    col_id        varchar(45) null,
    sex           varchar(45) null,
    ages          int         null,
    weights       varchar(45) null,
    assay_station varchar(45) null,
    constraint col1
        foreign key (col_id) references columns (col_name)
            on update cascade on delete cascade,
    constraint time1
        foreign key (ages) references times (days)
            on update cascade on delete cascade
);

create index col1_idx
    on swine (col_id);

create index time1_idx
    on swine (ages);

